import React from "react";

export default function CompetitionsItem(props) {
  let [sprungFloor, setSprungFloor] = useState(null);

  if (props.competitionsItem.sprung_floor) {
    sprungFloor = `${(<i className="fa-solid fa-check"></i>)}`;
  } else {
    sprungFloor = null;
  }
  if (props.competitionsItem.prep_divisions) {
    prepDivisions = `${(<i className="fa-solid fa-check"></i>)}`;
  } else {
    prepDivisions = null;
  }
  if (props.competitionsItem.asw_bids) {
    aswBids = `${(<i className="fa-solid fa-check"></i>)}`;
  } else {
    aswBids = null;
  }

  if (
    props.competitionsItem.summit_bids &&
    props.competitionsItem.summit_bids_year
  ) {
    summitBids = `${`${(<i className="fa-solid fa-check"></i>)}`} (${
      props.competitionsItem.summit_bids_year
    })`;
  } else if (props.competitionsItem.summit_bids) {
    summitBids = `${(<i className="fa-solid fa-check"></i>)}`;
  } else {
    summitBids = null;
  }

  if (
    props.competitionsItem.worlds_bids &&
    props.competitionsItem.worlds_bids_year
  ) {
    worldsBids = `${`${(<i className="fa-solid fa-check"></i>)}`} (${
      props.competitionsItem.summit_bids_year
    })`;
  } else if (props.competitionsItem.worlds) {
    worldsBids = `${(<i className="fa-solid fa-check"></i>)}`;
  } else {
    worldsBids = null;
  }

  return (
    <tbody>
      {competitionsData.map(function (competitionsItem, index) {
        return (
          <tr key={index} className="competitionsItem">
            <th scope="row">{props.competitionsData[index].event_provider}</th>
            <td>{props.competitionsData[index].competition_name}</td>
            <td>{props.competitionsData[index].date}</td>
            <td>{props.competitionsData[index].location}</td>
            <td className="text-center">{sprungFloor}</td>
            <td className="text-center">{prepDivisions}</td>
            <td className="text-center">{aswBids}</td>
            <td className="text-center">{summitBids}</td>
            <td className="text-center">{worldsBids}</td>
            <td>
              <a
                href={competitionWebpageLink}
                target="_blank"
                rel="noreferrer noonpener"
              >
                {competitionWebpageTitle}
              </a>
            </td>
          </tr>
        );
      })}
    </tbody>
  );
}
